function successVSfailures(num, sketchObject){
    var y_axis=[];
	var temp=10;
	for (var i=0; i<sketchObject.results.length;i++){
		y_axis.push(temp);
		temp=temp+100
	}

	var para = document.createElement("P");
    para.style.zIndex = 8;
    para.style.position = "absolute";
    para.style.fontSize = "medium";
    para.style.left="1475px";
    para.style.top="270px";
    var t = document.createTextNode("Successful vs Unsuccessful");
    para.appendChild(t);
    document.getElementsByTagName("body")[0].appendChild(para);


    var outerDiv = document.createElement("div");
    outerDiv.id = "SuccessesFailures";
    outerDiv.width = 150;
    outerDiv.height = num*100;
    outerDiv.style.zIndex = 8;
    outerDiv.style.position = "absolute";
    outerDiv.style.border = "1px solid";
    outerDiv.style.left="1500px";
    outerDiv.style.top="300px";
    var body = document.getElementsByTagName("body")[0];
    body.appendChild(outerDiv);

    var sketches = [];

    for(var count=0; count<num; count++){
        tempObject = sketchObject.results[count];

        cursorLayer = document.getElementById("SuccessesFailures");

        var div = document.createElement("div");
        div.id = "sketch" + count;
        div.style.width = "150px";
        div.style.height = "100px";
        div.style.position = "relative";
        outerDiv.appendChild(div);

        var c = document.createElement("canvas");
        c.id = "";
        c.width = 150;
        c.height = 100;
        c.style.zIndex = 8;
        var body = document.getElementsByTagName("body")[0];
        div.appendChild(c);

        var ctx = c.getContext("2d");

        if (Math.random(1) > 0.5){ // if it's successful and the check val is 1 draw it green
           ctx.strokeStyle="#008000";
           sketches.push(1);
        } else { // if it's unsuccessful and the check val is -1 draw it red
           ctx.strokeStyle="#FF0000";
           sketches.push(-1);
        }

        ctx.beginPath();
        for(var i =0;i<tempObject.x_data.length;i+=2){
            ctx.moveTo((tempObject.x_data[i]/10)+20,(tempObject.y_data[i]/10));
            ctx.lineTo((tempObject.x_data[i+1]/10)+20, (tempObject.y_data[i+1]/10));
        }
        ctx.stroke();
    }

    return sketches;
}

function updateTrainingData(sketches){
    for(var i = 0; i < sketches.length; i++){
        if(sketches[i] == 1){
            var randomNum = Math.floor(Math.random() * 100) + 0;
            var x1 = $("#trainingData" + randomNum).offset().left;
            var y1 = $("#trainingData" + randomNum).offset().top;

            var x2 = $("#sketch" + i).offset().left;
            var y2 = $("#sketch" + i).offset().top;
            var leftDistance = x2 - x1;
            var topDistance = y2 - y1;

            $("#trainingData" + randomNum).animate({left:'1500px'}, 5000);
            $("#sketch" + i).animate({right:leftDistance+'px', bottom:topDistance+'px'}, 2500);
        }
    }
}
